import React from 'react'

function about() {
  return (
    <div className='content'>
        <div className='history'>
            <h1>Our journey</h1>
            <p>Founded in 2021, EduLearn is a platform that aims to provide quality educational resources to students of all ages. Our mission is to empower students to achieve academic excellence by providing them with the tools they need to succeed. Whether you are looking for school papers, educational videos, or short notes, EduLearn has you covered. Join us on our journey to make education accessible to all!</p>
        </div>

    </div>
  )
}

export default about
